Penn Libraries call number: GrC P9428 Ei7 1547

Bookplate: &quot;Ex libris Hugh Tempest Sheringham date [blank] no. [blank]&quot;
Inscription: &quot;A. Lamont&quot;
Probably Austin Lamont (1905-1969), son of Thomas W. Lamont, banker at JP Morgan after whom Harvard's Lamont Library is named. According to <a href="http://journals.lww.com/anesthesiology/Fulltext/1996/02000/Austin_Lamont_and_the_Evolution_of_Modern_Academic.23.aspx" rel="nofollow">this article</a> in <i>Anesthesiology</i>, Austin Lamont was &quot;originally planning to study classic Latin and Greek at the New College, Oxford University, England, [but] he changed his mind while still on the steamship headed for Europe.&quot;  He instead studied science and became a doctor and professor of anesthesiology at the University of Pennsylvania School of Medicine (1947-mid1960s).

Austin and his 2nd wife Bodine were Philadelphia elites and associated with other prominent Philadelphians Carl and Laura Zigrosser.  Carl Zigrosser was a prints curator at the Philadelphia Museum of Art and member of the Print Club (Philadelphia). A finding aid to Zigrosser's papers is available <a href="http://dla.library.upenn.edu/dla/ead/detail.html?id=EAD_upenn_rbml_MsColl6PUSpMsColl6" rel="nofollow">here</a>.

